import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

import PlayerViewer from './PlayerViewer';

function App() {
  return (
    <Router>
      <div>
        <ul>
          <li><Link to='/'>Home</Link></li>
          <li><Link to='/p'>Player Dashboard</Link></li>
        </ul>
        <hr />
        <Switch>
          <Route exact path='/'>
            <App />
          </Route>
          <Route path='/p'><PlayerViewer /></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
